import React from "react"

const EmptyThreadInfoBox = (props) => {
	// the container div should have the contents inside stack vertically
	return (
		<div className="flex flex-col mb-8 md:mb-auto gap-3.5 flex-1">
			<div className="title text-center font-bold">{props.title}</div>
			{/* put text 1 in a text div */}
			<ul className="flex flex-col gap-3.5 w-full sm:max-w-md m-auto">
				{props.text1}
			</ul>
			<div className="text">{props.text2}</div>
			<div className="text">{props.text3}</div>
		</div>
	)
}

export default EmptyThreadInfoBox
